import React from 'react'
import Card from './Card'

export default function FeedbackForm() {
  return (
    <Card>
  <div>FeedbackForm
        <h2> How would you rate your  service with us?</h2>
        <input placeholder='Write a review'/>
        <button type='submit'>Send </button>
    </div>
    </Card>

  )
}
